import React from 'react';
import { connect } from 'react-redux';
import { actions } from '../Redux/Store/actions';
import { compose } from "redux";
import { withRouter } from 'react-router-dom';

const mapDispatchToProps = (dispatch) => ({
    setDataTable: (data) => dispatch(actions.setDataTable(data)),
})
export default compose(withRouter, connect(null,mapDispatchToProps))(function TableDynamic(props) {
    const { setDataTable } = props;
 function getAllData(){ 
    fetch("http://localhost:3001/getUser", {
        method: "get",
        headers: { "Content-Type": "application/json" },
    })
        .then(res => res.json())
        .then((data) => {
            console.log(data)
            setDataTable(data);
        })
        .catch(err => console.log(err))
  }  
    return (
        <>
        <br/>
        <button type="button" class="btn btn-outline-primary" onClick={getAllData}>Click me</button>

        <table class="table">
  <thead class="thead-dark">
    <tr>
      <th scope="col">#</th>
      <th scope="col">First</th>
      <th scope="col">Last</th>
      <th scope="col">Handle</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <th scope="row">1</th>
      <td>Mark</td>
      <td>Otto</td>
      <td>@mdo</td>
    </tr>
    </tbody>
</table>
        </>
    )
})
